class VodExtension extends Extension {
  api = ''
  headers = {
    'User-Agent':
      'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36'
  }
  videoInfoCache = {}

  async latest(page) {
    const res = await this.callApi({ action: 'videolist', page })
    res.list.forEach(item => {
      this.videoInfoCache[item.vod_id] = item
    })
    return res.list.map(item => ({
      title: item.vod_name,
      url: item.vod_id.toString(),
      cover: item.vod_pic,
      //desc: item.vod_content,
      update: item.vod_remarks
    }))
  }

  async createFilter(filter) {
    return {
      category: {
        title: '分类',
        max: 1,
        min: 1,
        default: 'all',
        options: {
          all: '全部',
          ...(await this.category())
        }
      }
    }
  }

  async search(kw, page, filter) {
    const category = filter?.category?.[0]
    if (!kw && (!category || category === 'all')) {
      return this.latest(page)
    }
    let res
    if (category && category !== 'all') {
      res = await this.callApi({
        type: category,
        page,
        action: 'videolist'
      })
    } else {
      res = await this.callApi({ query: kw, page, action: 'videolist' })
    }
    res.list.forEach(item => {
      this.videoInfoCache[item.vod_id] = item
    })
    return res.list.map(item => ({
      title: item.vod_name,
      url: item.vod_id.toString(),
      cover: item.vod_pic,
      //desc: item.vod_content,
      update: item.vod_remarks
    }))
  }

  async detail(url) {
    const item =
      this.videoInfoCache[url] ||
      (await this.callApi({ ids: url, action: 'videolist' })).list[0]
    const servers = item.vod_play_from.split('$$$')
    const episodes = []

    loop: for (const [index, playlist] of Object.entries(
      item.vod_play_url.split('$$$')
    )) {
      const urls = []
      for (const info of rtrim(playlist, '#').split('#')) {
        const [episodeName, playUrl] = info.split('$')
        if (!playUrl.endsWith('.m3u8')) {
          continue loop
        }
        urls.push({
          name: episodeName,
          url: playUrl
        })
      }
      episodes.push({
        title: servers[index],
        urls
      })
    }
    var desc = item.vod_blurb
    if (!desc) {
      desc = item.vod_content
    }

    return {
      title: item.vod_name,
      cover: item.vod_pic,
      desc,
      episodes
    }
  }

  async watch(url) {
    return {
      type: 'hls',
      url
    }
  }

  async category() {
    if (this.categoryCache) {
      return this.categoryCache
    }
    const res = await this.callApi()
    const options = Object.fromEntries(
      res.class.map(item => [item.type_id, item.type_name])
    )
    this.categoryCache = options
    return options
  }

  async callApi({
    query,
    page = 0,
    ids,
    type,
    pageSize,
    action = 'list'
  } = {}) {
    var params = `?ac=${action}`
    if (query) {
      params += `&wd=${encodeURIComponent(query)}`
    } else if (ids) {
      params += `&ids=${ids}`
    }
    if (page > 0) {
      params += `&pg=${page}`
    }
    if (type) {
      params += `&t=${type}`
    }
    if (pageSize) {
      params += `&pagesize=${pageSize}`
    }
    const options = {
      headers: {
        ...this.headers,
        Referer: this.api + params,
        'Miru-Url': this.api
      },
      method: 'get'
    }
    const res = await this.request(params, options)
    if (typeof res === 'string') {
      return convertToJson(res)
    }
    return res
  }
}

class Ext extends VodExtension {
  api = 'https://cj.bajiecaiji.com/inc/api.php/provide/vod/'

  async search(kw, page, filter) {
    if (kw) {
      throw '不支持搜索'
    }
    return super.search(kw, page, filter)
  }
}

function rtrim(str, ch) {
  let i = str.length
  while (i-- && str.charAt(i) === ch);
  return str.substring(0, i + 1)
}

function convertToJson(xml) {
  var $ = cheerio.load(xml, { xmlMode: true })
  const list = []
  const clazz = []
  $('video').each((i, el) => {
    const $el = $(el)
    const vod_id = $el.find('id').text()
    const vod_name = $el.find('name').text()
    const vod_pic = $el.find('pic').text()
    const vod_remarks = $el.find('note').text()
    const vod_blurb = $el.find('des').text()
    const playData = $el.find('dl dd')
    const vod_play_from = playData
      .map((i, el) => $(el).attr('flag'))
      .get()
      .join('$$$')
    const vod_play_url = playData
      .map((i, el) => $(el).text())
      .get()
      .join('$$$')
    list.push({
      vod_id,
      vod_name,
      vod_pic,
      vod_blurb,
      vod_remarks,
      vod_play_from,
      vod_play_url
    })
  })
  $('class ty').each((i, el) => {
    const $el = $(el)
    const type_id = $el.attr('id')
    const type_name = $el.text()
    clazz.push({ type_id, type_name })
  })
  return { list, class: clazz }
}
